<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Image Grid</title>
    <style>
      body {
        position: relative;
        height: 100%;
        width: 100%;
        margin: 0;
        padding: 0;
        display: flex;
        flex-direction: column;
        flex-wrap: nowrap;
        justify-content: flex-start;
        align-items: center;
        align-content: center;
      }
      body * {
        margin-bottom: 2rem;
      }

      .contenido {
        margin-top: 4rem;
        position: relative;
        top: 10%;
        left: 0%;
        width: 100%;
        height: 100%;
        display: grid;
        grid-template-columns: repeat(auto-fill, minmax(300px, 300px));
        gap: 1.24rem 2rem;
        padding: 0px;

        justify-content: center;
      }

      .box-img {
        position: relative;
        width: 100%;
        height: 300px;
        background-color: rgba(255, 255, 255, 0.425);
        border: 4px solid #919191;
        border-radius: 9px;
        overflow: hidden;
      }

      .class-img {
        width: 100%;
        height: 100%;
        object-fit: cover;
      }

      .bt-downdload {
      
        width: 33px;
        height: 33px;
        background-color: rgba(0, 0, 0, 0.856);
        color: rgb(255, 255, 255);
        text-align: center;
        display: flex;
        justify-content: center;
        align-items: center;
        transition: 0.3s;
        cursor: pointer;

        border-radius: 50%;
        font-size: 12px;
      }

      .bt-downdload:hover {
        color: rgb(0, 174, 255);
      }
      .divAbirirImgs{
   
        width: 33px;
        height: 33px;
        background-color: rgba(0, 0, 0, 0.856);
        color: rgb(255, 255, 255);
        text-align: center;
        display: flex;
        justify-content: center;
        align-items: center;
        transition: 0.3s;
        cursor: pointer;
        border-radius: 50%;
        font-size: 12px;
      }
      .divAbirirImgs:hover {
        color: rgb(0, 174, 255);
      }

      .clMenuSeleccion::-webkit-scrollbar {
        width: 8px;
      }

      .clMenuSeleccion::-webkit-scrollbar-track {
        background: transparent;
      }

      .clMenuSeleccion::-webkit-scrollbar-thumb {
        background-color: #888;
        border-radius: 4px;
      }

      .clMenuSeleccion::-webkit-scrollbar-thumb:hover {
        background-color: #555;
      }
      #idboxT {
        position: fixed;
        top: 0%;
        left: 0%;

        /*     transform: translate(-50%,-50%); */

        width: 100%;
        height: 100vh;

        min-height: 250px;
        min-width: 250px;
        background-color: rgb(255, 255, 255);
        z-index: 20;
        overflow-y: scroll;
        display: none;
        flex-direction: column;
        flex-wrap: nowrap;
        justify-content: flex-start;
        align-items: center;
        align-content: center;
      }
      #idboxT * {
        margin-bottom: 2rem;
      }

      #idClose {
        position: fixed;
        top: 40%;
        right: 2%;
        width: 44px;
        height: 44px;
        transform: translate(-50%, -50%);
        color: #ffffff;
        background-color: rgba(0, 0, 0, 0.568);
        display: flex;
        flex-direction: column;
        flex-wrap: nowrap;
        justify-content: center;
        align-items: center;
        align-content: center;
        font-size: 12px;
        border: 3px solid #838383;
        border-radius: 50%;
        transition: 1s;
        cursor: pointer;
        z-index: 6;
      }
      #idClose:hover {
        color: #33b0e2;
      }

      #idDescargas {
        position: fixed;
        top: 60%;
        right: 2%;
        width: 44px;
        height: 44px;
        transform: translate(-50%, -50%);
        color: #ffffff;
        background-color: rgba(0, 0, 0, 0.493);
        display: flex;
        flex-direction: column;
        flex-wrap: nowrap;
        justify-content: center;
        align-items: center;
        align-content: center;
        font-size: 12px;
        border: 3px solid #838383;
        border-radius: 50%;
        transition: 1s;
        cursor: pointer;
        z-index: 6;
      }
      #idDescargas:hover {
        color: #33b0e2;
      }
      .classSumamargin {
        margin-top: 3rem;
      }
      .clidImgPro {
        width: 100%;
        height: 100%;
        min-width: 250px;
        min-height: 250px;
        max-width: 400px;
        max-height: 400px;
      }

      .bt-containerImgs{
        position: absolute;
        bottom: -40px;
        left: 0%;
        width: 100%;
        height: 40px;
        display: flex;
	flex-direction: row;
 
      }
      .bt-containerImgs *{
        margin-left: 1rem;
      }
      

     
      @import url('https://fonts.googleapis.com/css?family=Nova+Mono');
h1{
    font-family: "Nova Mono", monospace;
    text-align: center;
    font-size: 35px;
    color: rgb(0, 0, 0);
    background-color: rgba(84, 84, 84, 0.13);
    text-shadow: rgba(0, 0, 0, 0.164) 2px 2px 2px;
    
}
.cldivklineal{
    position: absolute;
    top: 10%;
    left: 0%;
    width: 37px;
    height: 100%;
    background-color: #33b0e2;
    border-right: 5px dotted #000000;
border-radius: 9px;
background: rgb(255,255,255);
background: linear-gradient(90deg, rgba(255,255,255,1) 0%, rgba(70, 70, 70, 0.521) 100%);
}
h6{
  font-size:small ;
  width: 120px;
  text-align: center;
}
    </style>
